import React, { useState, useEffect } from 'react';
import { AppBar, Toolbar, InputBase, Typography, Grid } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import axios from 'axios';
import ProfileCard from './profilecard'; 

const apiUrl = 'https://mocki.io/v1/ddb7e0a8-e218-4e36-b1be-b902cdb1c098';

const UserDetails = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios.get(apiUrl)
      .then(response => {
        setUsers(response.data);
      })
      .catch(error => {
        console.error('Error fetching user details:', error);
      });
  }, []);

  return (
    <div>
      <AppBar position="static" sx={{ bgcolor: '#2196F3' }}>
        <Toolbar>
          <Typography variant="h6">
            User Details
          </Typography>
          <div style={{ position: 'relative' }}>
            <div style={{ position: 'absolute', display: 'flex', alignItems: 'center', justifyContent: 'center', height: '100%' }}>
              <SearchIcon />
            </div>
            <InputBase
              placeholder="Searchâ€¦"
              sx={{ pl: 6 }}
            />
          </div>
        </Toolbar>
      </AppBar>
      <Grid container spacing={3} marginTop={2}>
        {users.map(user => (
          <Grid item xs={12} key={user.id}>
            <ProfileCard user={user} />
          </Grid>
        ))}
      </Grid>
    </div>
  );
};

export default UserDetails;
